import React from 'react';

const Sidebar = ({ modules, activeModule, setActiveModule }) => {
    return (
        <aside className="sidebar">
            <nav>
                <ul>
                    {modules.map(mod => (
                        <li key={mod.name} className={mod.name === activeModule ? 'active' : ''}>
                            <a href="#" onClick={() => setActiveModule(mod.name)}>
                                {mod.name.charAt(0).toUpperCase() + mod.name.slice(1)}
                            </a>
                        </li>
                    ))}
                </ul>
            </nav>
        </aside>
    );
};

export default Sidebar;
